text:
@TimeIsNotGiven I'm specifically having a hard time with the word "dramatic". 

Even knowing that this was discussed with him, his response was still reasonable and also age appropriate.

"Dramatic" is often used to passively describe children's behaviors when adults just don't understand them.

@TimeIsNotGiven Dramatic or reacting to a sudden change to his bike that he did not expect or have control over? 

It's a reasonable response to be scared or anxious about riding a bike without training wheels if he's never done it before.

I'm glad he wasn't too scared to try! 💙

@HarleyShah Watching new things takes more energy!

It's easier to process what's familiar to you, because it's comforting knowing exactly what to expect!

Not knowing what's going to happen, can trigger feelings of anxiety.

@dazhq_ @Simply__Zah Because not everyone follows the conversation in the replies, sometimes people look at quote retweets.

Algorithms bury or hide posts. Double tweeting gives people more of a chance to see my tweets. 

I like having multiple ways for people to participate in a discussion. 🤗

@raisingwhasians +Merida refused to be married despite tradition

+Rapunzel lied to Mother Gothel to sneak out with a wanted theif that she met when he broke into her home

+Moana disobeyed her father &amp; took a boat out into the ocean TWICE! (second time with her mother and grandmother's help 😉)

@Saraheboon I hate job interviews.

Interviews force me to worry about EVERYTHING about myself.

My clothes, my hair, my eye contact, my handshake *shudders* 🤢, my tone of voice, my humor, my fidgets, my bluntness, my hobbies, my transportation (I don't drive), my past, my future, my goals.

@coachshellyc We need to fight THIS SPECIFIC TRAUAMA every single day. This is why I was considered such a disobedient child and argumentative teenager and confrontational adult.

My ENTIRE life I have been told "Just be yourself! BUT NOT LIKE THAT!"

IT. NEEDS. TO. STOP. #ActuallyADHD

@TimeIsNotGiven Jo I consider us to be friends. 💙

And abandoning your friends for a relationship is a 🚩. When people are isolated in a relationship, it makes it easier for them to be abused for a number of reasons.

This isn't typical behavior at all.

@thedigitaldash_ Honestly, I think "talent" won't ever compare to passion. 

Especially with art. 

Passion drives creativity by motivating us to learn more and to try to do better. Someone can be naturally talented, but without passion, they won't have the drive to push their skills any further.

@MadeInHawaii___ Ask me! I'm reliable! 💪🏾

The thing I wish more people did is be honest about what they can and cannot do for others instead of setting unrealistic expectations.

If I can't help in the ways you need, I'll let you know, but I'll always do what I can to assist! 💙

@MadeInHawaii___ If you know what they enjoy, get them something that they can always use more of.

Like, if they play alot of Nintendo Switch games, I'd gift a Nintendo eShop card so they can get themselves more games or DLC.

I suppose it's just a gift card, but it still shows you know them.

@blueskye12367 @AskADHD Let go of gym memberships and work out routines and just move your body in ways that feel good to you. 

Go on walks in your neighborhood, dance around your house, have more sex.

Don’t feel ashamed if you don’t “work out”. Moving your body everyday is all you need to do. 💙

